import React from "react";
import { Button } from "react-bootstrap";

const ContextMenuButton = (props) => {
	return (
		<div>
			{props.buttons.map((button, index) => {
				return (
					<Button key={index} onClick={props.setActive(index)}>
						{button}
					</Button>
				);
			})}
		</div>
	);
};

export default ContextMenuButton;
